import React from 'react';
import { NavLink } from 'react-router-dom';
import './Accueil.css'; // Stilizacija za Accueil komponentu
import sportseeLogo from './sportsee-logo.png'; // Uvoz slike logotipa

const Accueil = () => {
  return (
    <div className="accueil">
      <div className="background">
        <img src={sportseeLogo} alt="Sportsee Logo" className="logo" />
      </div>
      <div className="button-container">
        <NavLink to="/profil/12" className="circle-button" id="profil12">
          12
        </NavLink>
        <NavLink to="/profil/18" className="circle-button" id="profil18">
          18
        </NavLink>
      </div>
    </div>
  );
};

export default Accueil;
